import Navbar from '../../components/navbar'
import Literature from '../../dataLiterature.json'
import Card from '../../components/card'

export default function MyCollection(){
    return(
        <>
        <Navbar/>
        <div id="myCollection">
            <h1>My Collection</h1>
            <div id="literature-list">
                {Literature.map((item) => (<Card item={item} />))}
            </div>
        </div>
        </>
    )
}
